import axios from 'axios';
import Vue from 'vue';

export default class AxiosTest extends Vue {
  //　日付を指定
  // date:Date=new Date();
  date:Date = new Date('2023-09-01');

  //日・週・月のデータを格納する
  day_data:{[key:number]:Array<any>}={};
  week_12_data:{[key:number]:Array<any>}={};
  month_data:{[key:number]:Array<any>}={};

  async get_day_data(){
      // postで送信するデータ
      let post_data={
          "date":[...Array(1)].map((_,index)=>{
            let date:Date=new Date();
            date.setDate(this.date.getDate()-index);
            return date.toISOString().slice(0,10);
          }),
      };

      //水深ごとのデータを持ってくる。
      //  postでデータを送信
      await axios.post('https://8bkd65vrbj.execute-api.ap-northeast-1.amazonaws.com/dev/query',post_data)
          .then((response)=>{
              // データ取得
              let response_data=response.data.body;
              // console.log(response_data);
              // sort_data関数の戻り値（ソートされたデータ）を代入
              let sort_data=this.sort_data(response_data);
              //データを1日ごとに分ける
              let split_day_data=this.split_day(sort_data);
              // データを1時間ごとの集合に分ける
              let split_hour_data=this.split_hour(split_day_data);
              // データを水深毎にとる(指定された日のみ)
              this.day_data=this.extract_data(split_hour_data[this.date.toISOString().slice(0,10)]);
              console.log(this.day_data)
          });
  }

  async get_week_data(){
      // postで送信するデータ
      let post_data={
          "date":[...Array(7)].map((_,index)=>{
            let date:Date=new Date();
            date.setDate(this.date.getDate()-index);
            return date.toISOString().slice(0,10);
          }),
      };

      //水深ごとのデータを持ってくる。
      //  postでデータを送信
      await axios.post('https://8bkd65vrbj.execute-api.ap-northeast-1.amazonaws.com/dev/query',post_data)
          .then((response)=>{
              // データ取得
              let response_data=response.data.body;
              // console.log(response_data);
              // sort_data関数の戻り値（ソートされたデータ）を代入
              let sort_data=this.sort_data(response_data);
              //データを1日ごとに分ける
              let split_day_data=this.split_day(sort_data);
              // データを1時間ごとの集合に分ける
              let split_hour_data=this.split_hour(split_day_data);
              // データを水深毎にとる（１週間分のデータで、その日の12時のデータを表示）
              this.week_12_data=this.week_12(split_hour_data);
          });
  }

  async get_month_data(){
      // postで送信するデータ
      let post_data={
          "date":[...Array(30)].map((_,index)=>{
            let date:Date=new Date();
            date.setDate(this.date.getDate()-index);
            return date.toISOString().slice(0,10);
          }),
      };

      //水深ごとのデータを持ってくる。
      //  postでデータを送信
      await axios.post('https://8bkd65vrbj.execute-api.ap-northeast-1.amazonaws.com/dev/query',post_data)
          .then((response)=>{
              // データ取得
              let response_data=response.data.body;
              // console.log(response_data);
              // sort_data関数の戻り値（ソートされたデータ）を代入
              let sort_data=this.sort_data(response_data);
              //データを1日ごとに分ける
              let split_day_data=this.split_day(sort_data);
              // データを1時間ごとの集合に分ける
              let split_hour_data=this.split_hour(split_day_data);
              // データを水深毎にとる（１ヶ月分のデータで、その日の12時のデータを表示）
              this.month_data=this.month_12(split_hour_data);
          });
  }

  // データをソートするための関数
  sort_data(response_data:any){
    let time_data:Array<string>=[]
    let sort_data:any=[];
    response_data.forEach((element: { timestamp: string; }) => {
      time_data.push(element.timestamp);
    });
    time_data.sort();
    time_data.forEach((time)=>{
      response_data.forEach((element: { timestamp: string; }) => {
        if (time==element.timestamp){
          sort_data.push(element);
        }
      });
    });
    return sort_data;
  }

  //データを1日毎のグループに分割
  split_day(sort_data:any){
    let map:{[key:string]:Array<any>}={};
      let day=""
      sort_data.forEach((element: { timestamp: string; }) => {
        if (day!=element.timestamp.slice(0,10)){
        map[element.timestamp.slice(0,10)]=[element];
        }
        else{
          let array=map[element.timestamp.slice(0,10)]
          array.push(element);
          map[element.timestamp.slice(0,10)]=array;
        }
        day=element.timestamp.slice(0,10);
      });
      return map;
  }

  // データを１時間毎のグループに分割
  split_hour(split_day_data:{[key:string]:Array<any>}){
    let main_map:{[key:string]:{[key:string]:Array<any>}}={};
      for (let [key,value] of Object.entries(split_day_data)){
        let map:{[key:string]:Array<any>}={};
        let hour=""
        value.forEach((element: { timestamp: string; }) => {
          if (hour!=element.timestamp.slice(11,13)){
          map[element.timestamp.slice(11,13)]=[element];
          }
          else{
            let array=map[element.timestamp.slice(11,13)]
            array.push(element);
            map[element.timestamp.slice(11,13)]=array;
          }
          hour=element.timestamp.slice(11,13);
        });
        main_map[key]=map;
      }
      console.log(main_map);
      return main_map;
  }

  // 各水深におけるデータに分割
  extract_data(split_data:{[key:string]:Array<any>}){
    let extract_data:{[key:number]:Array<any>}={};
    for(let i=1; i<=11; i++){
      extract_data[i]=[]
      for (let key in split_data){
        let data:any;
        let deff_array:Array<number>=[];
        split_data[key].forEach((element:{deep:string})=>{
          if (element.deep!="None"){
            deff_array.push(Math.abs(Number(element.deep)-i));
          }
        });
        let min=Math.min(...deff_array);
        let index=deff_array.indexOf(min);
        data=split_data[key][index];
        extract_data[i].push(data);
      }
    }
    for (let key in extract_data){
      extract_data[key]=this.sort_data(extract_data[key]);
    }
    return extract_data;
  }

  // 一週間分の12時のデータ取得
  week_12(split_hour_data:{[key:string]:{[key:string]:Array<any>}}){
    let map:{[key:string]:Array<any>}={};
    let keys=Object.keys(split_hour_data).slice(-7);
    keys.forEach((key)=>{
      if ("12" in split_hour_data[key]){
        map[key]=split_hour_data[key]["12"];
      }else{
        let keys2=Object.keys(split_hour_data[key]);
        map[key]=split_hour_data[key][keys2.pop() as string];
      }
    });
    map=this.extract_data(map);
    return map;
  }

  // １ヶ月分の12時のデータ取得
  month_12(split_hour_data:{[key:string]:{[key:string]:Array<any>}}){
    let map:{[key:string]:Array<any>}={};
    for (let [key,value] of Object.entries(split_hour_data)){
      if ("12" in value){
        map[key]=value["12"];
      }else{
        let keys=Object.keys(value);
        map[key]=value[keys.pop() as string];
      }
    }
    map=this.extract_data(map);
    return map;
  }
}
